import axios from 'axios';

export const GET_REGION = 'GET_REGION';

export const getRegion = async () => {
  try {
    const res = await axios.get('http://api.training.div3.pgtest.co/api/v1/location');
    console.log(res);
    return { type: GET_REGION, payload: res.data.data };
  } catch {}
};
